export type TDungeonObj = typeof dungeonMaxTimestamp;
export type TDungeonKeys = keyof TDungeonObj;
export type TDungeonWeeks = 'Tyrannical' | 'Fortified';

export type TDungeonCard = {
  id: number;
  abbreviation: TDungeonKeys;
  name: string;
  imgBackground: TDungeonImage;
};

export type TRunStats = Array<{
  short_name: string;
  affixes: Array<{ name: string }>;
  score: number;
  mythic_level: number;
  clear_time_ms: number;
}>;

export const getDungeonLimitTimestampValues = (dungeon: TDungeonKeys) => {
  const maxValue = Math.round(dungeonMaxTimestamp[dungeon] * 0.4);
  const minValue = maxValue * -1;

  return { minValue, maxValue };
};

